import "./styles.css";
import Header from "./header"
import Datas from "./datas/Datas";
import * as Yup from 'yup';

function App() {
  return (
    <div className="wrapper">
        <Header/>
      <div className="main">
        <Datas></Datas>
      </div>
    </div>
  );
}

export const useValidation = () => {
  return Yup.object().shape({
    productName: Yup.string("No campo nome do produto não é permitido inserir números.").required("Por favor, digite o seu nome do produto!"),
  })
}

export default App;
